import React, { Fragment } from 'react';
import './App.css';
import SignInPage from './component/SignIn';
import SignUp from './component/SignUp';
import TaskManager from './component/TaskManager';

function App() {
  return (
    <Fragment>
      <div>
        <SignInPage/>
      </div>
      <hr/>
      <div>
        <SignUp/>
      </div>
      <div>
        <TaskManager/>
      </div>
    </Fragment>
  );
}

export default App;
